        "vaeua-gui-eua.sas.van.Insights.outliers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ข้อมูลเชิงลึกของ <span class\\="xis-windowItem">ค่าผิดปกติ</span> ระบุรายการข้อมูลในรายงานของคุณที่อาจได้รับอิทธิพลจากค่าผิดปกติ</p><p class\\="xis-paragraph">หากต้องการดูการวิเคราะห์ค่าผิดปกติสำหรับการวัด ให้คลิก<span data-icon-name\\="information" alt\\="ไอคอนข้อมูล" aria-label\\="ไอคอนข้อมูล"></span> ด้านข้างมาตรวัด จากนั้นคลิก <span class\\="xis-windowItem">ดูการวิเคราะห์ค่าผิดปกติ</span> ในหน้าต่างป๊อปอัพ</p><p class\\="xis-paragraph">หากต้อการดูผลของค่าผิดปกติบนวัตถุในรายงานของคุณ ให้คลิก<span class\\="xis-windowItem">วิเคราะห์วัตถุสำหรับผลกระทบ</span> เมื่อการวิเคราะห์เสร็จสมบูรณ์ ให้คลิก<span class\\="xis-windowItem">รายละเอียด</span> ข้างชื่อวัตถุเพื่อดูการวิเคราะห์ค่าผิดปกติโดยละเอียดในวัตถุนั้น</p><div class\\="xis-note"><span class\\="xis-noteGenText">หมายเหตุ\\:</span>ข้อมูลเชิงลึกของ <span class\\="xis-windowItem">ค่าผิดปกติ</span> ระบุค่าผิดปกติทั้งหมดในแหล่งข้อมูลของคุณ แม้ว่าวัตถุรายงานของคุณจะไม่รวมค่าโดยใช้ตัวกรองหรืออันดับ</div></section>',
