        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.reusePredictors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ช่วยให้ตัวคาดการณ์สามารถใช้ซ้ำในกฎการแยกไปยังโหนดใบได้ เมื่อไม่ได้เลือก ตัวคาดการณ์สามารถปรากฏเพียงครั้งเดียวในกฎการแยกสะสมไปยังโหนดใบ</p></section>',
        "vaeua-gui-eua.Properties.assessment.showAllPlots.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">แสดงกราฟการประเมินทั้งหมดที่พร้อมใช้งาน รวมถึงเมทริกซ์ความสับสน, ROC, ลิฟต์ (Lift) และการจัดกลุ่มผิด</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.max.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุจำนวนสูงสุดของกลุ่มที่แสดงเมื่อข้อมูลแผนที่เกินขีดจำกัดข้อมูลระบบ หากข้อมูลแผนที่ไม่เกินขีดจำกัดข้อมูลระบบ ตัวเลือกนี้จะไม่มีผลกระทบ</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighReportHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ลบตัวควบคุมออกจากพื้นที่พร้อมท์ของรายงานเพื่อแก้ไขปัญหาต่อไปนี้ ตัวอย่างเช่น หากต้องการแก้ไขปัญหาที่มีลำดับความสำคัญปานกลาง ให้ลดพื้นที่พร้อมท์ของรายงานเป็น 10 หรือน้อยกว่า</p><p class\\="xis-paragraph">ลำดับความสำคัญปานกลาง\\: มี &gt; 10 ออบเจ็กต์ในพื้นที่พร้อมท์ของรายงาน</p></section>',
