        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.leafSize.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุจำนวนขั้นต่ำของการสังเกตการณ์ที่อนุญาตในโหนดใบไม้ (เทอร์มินัล)</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุความแรงสัมพัทธ์ระหว่างกำลังเฉพาะที่และกำลังโดยรวมขณะที่จัดตำแหน่งโหนดและลิงก์ แผนผังของโหนดและลิงก์จะถูกกำหนดโดยอัลกอริทึมที่ควบคุมด้วยกำลัง (force-directed algorithm) อัลกอริทึมจะค้นหาตำแหน่งของโหนดที่ไม่อยู่ใกล้กันจนเกินไปและลิงก์ที่มีความยาวพอๆ กัน</p><p class\\="xis-paragraph">โดยทั่วไป ยิ่งมี<span class\\="xis-windowItem">แรงบังคับ</span>มากขึ้น ก็ยิ่งต้องมีระยะห่างระหว่างโหนดบนเครือข่ายมากขึ้นตามไปด้วย</p></section>',
