        "vaeua-gui-eua.sas.van.Options.alternativeText.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุชื่อที่มีความหมายและเข้าถึงได้สำหรับออบเจ็กต์ ข้อความจะถูกประกาศโดยโปรแกรมอ่านหน้าจอเมื่อผู้ใช้นำทางไปยังออบเจ็กต์</p></section>',
