        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ตัวเลือก <span class\\="xis-windowItem">แสดงผลค่าติ๊ก</span> ระบุวิธีการที่ใช้ในการปรับค่าเครื่องหมายติ๊กบนแกน X คุณสามารถเลือก <span class\\="xis-windowItem">ลดการทับซ้อนอัตโนมัติ</span> หรือ <span class\\="xis-windowItem">การวางแนวที่คงที่</span></p><div class\\="xis-paragraph">ตัวเลือก <span class\\="xis-windowItem">ลดการทับซ้อนอัตโนมัติ</span> ใช้เฉพาะเมื่อค่าติ๊กทับซ้อนกันเท่านั้น คุณสามารถระบุดังต่อไปนี้\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">ย้าย, ตัดทอน, ใส่</span></td><td>ย้ายค่าขึ้นและลงสลับกัน ตัดอักขระออกจากค่าติ๊ก จากนั้นใส่ค่าติ๊ก</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">หมุน 45°</span></td><td>หมุนค่าติ๊กทั้งหมด 45° แนวทแยงมุม</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">ย้าย, ตัดทอน</span></td><td>ย้ายค่าติ๊กขึ้นและลง จากนั้นตัดอักขระออกจากค่าติ๊ก</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">ตัดทอน</span></td><td>ตัดอักขระออกจากค่าติ๊ก</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">ตัดทอน, หมุน 45°</span></td><td>ตัดอักขระออกจากค่าติ๊ก จากนั้นหมุนค่าติ๊กทั้งหมด 45° ตามแนวทแยงมุม</td></tr></table></div>                 </div><div class\\="xis-paragraph">ตัวเลือก<span class\\="xis-windowItem">การวางแนวที่คงที่</span> จะถูกใช้เสมอและกำหนดการวางแนวของค่าต่างๆ คุณสามารถระบุดังต่อไปนี้\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">แนวนอน</span></td><td>แสดงค่าติ๊กในแนวนอน</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">หมุน 45°</span></td><td>หมุนค่าติ๊กทั้งหมด 45° แนวทแยงมุม</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">หมุน 45°, ใส่</span></td><td>หมุนค่าติ๊กทั้งหมด 45° ตามแนวทแยงมุม จากนั้นใส่ค่าติ๊ก</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "ข้อมูลเพิ่มเติมเกี่ยวกับตัวเลือกนี้ ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ดำเนินการคัดเลือกตัวแปรย้อนกลับแบบรวดเร็วเพื่อหาตัวแปรที่จะได้รับการพิจารณาใช้สร้างแบบจำลอง มีเพียงเฉพาะตัวแปรที่มี ค่า-<span class\\="xis-userSuppliedValue">p</span> ด้านล่างเท่านั้น ที่จะมีการพิจารณาระดับความชัดเจนที่ระบุ</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">รายงานของคุณใช้เวลาในการโหลดหน้าแรกนาน หาก <span class\\="xis-productName">SAS Visual                         Analytics</span> ระบุปัญหาด้านประสิทธิภาพอื่นนอกเหนือจากเวลาในการโหลดที่ช้า ให้แก้ไขปัญหาเหล่านั้นก่อน หากไม่มีการระบุปัญหาด้านประสิทธิภาพอื่น ๆ โปรดติดต่อผู้ดูแลระบบของคุณเพื่อตรวจสอบว่ามีปัจจัยอื่นใดที่ส่งผลกระทบต่อรายงานของคุณหรือไม่ ตัวอย่างเช่น การเชื่อมต่อที่ช้าอาจทำให้รายงานโหลดช้า</p><p class\\="xis-paragraph">ลำดับความสำคัญต่ำ\\: ใช้เวลา &gt;\\= 5 วินาที</p><p class\\="xis-paragraph">ลำดับความสำคัญปานกลาง\\: ใช้เวลา &gt;\\= 10 วินาที</p><p class\\="xis-paragraph">ลำดับความสำคัญสูง\\: ใช้เวลา &gt;\\= 25 วินาที</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "วิธีใช้ ข้อมูลเพิ่มเติมเกี่ยวกับตัวเลือกนี้ ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุฟังก์ชันการกระตุ้นที่ใช้สำหรับสร้างชั้นเอาต์พุตเมื่อใช้การแจกจ่ายแบบปกติเพื่อสร้างโมเดลการตอบสนอง ฟังก์ชันการกระตุ้นแบบเอกซ์โปแนนเชียลจะใช้กับการแจกแจงแกมมาหรือการแจกแจงปัวซอง (Poisson distribution)</p></section>',
