        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">ตัวเลือก<span class\\="xis-windowItem">ลำดับการเชื่อมต่อ</span> ระบุวิธีการเชื่อมต่อจุดข้อมูลเพื่อสร้างเส้นพล็อต <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">แกน</span></td><td>เชื่อมต่อจุดข้อมูลตามที่เกิดขึ้นจากซ้ายไปขวาบนแกน X</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">ข้อมูล</span></td><td>เชื่อมต่อจุดข้อมูลตามลำดับที่ซึ่งจุดข้อมูลเหล่านี้ถูกอ่านจากบทบาทของ X</td></tr></table></div>                 </div><p class\\="xis-paragraph">คุณสามารถใช้ค่านี้เพื่อให้แน่ใจว่ามีการเชื่อมต่อตามลำดับเมื่อข้อมูลอินพุตไม่ได้ถูกจัดเรียงตามบทบาทของ X</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุจำนวนเวกเตอร์สนับสนุนสูงสุด จำนวนจริงของสนับสนุนอาจมากกว่าจำนวนที่ระบุเล็กน้อยเนื่องจากลักษณะทั่วไปของวิธีการค่าแบบแอคทีฟ</p></section>',
        "vaeua-gui-eua.sas.van.Properties.object.title.help.aria.txt": "วิธีใช้ ข้อมูลเพิ่มเติมเกี่ยวกับตัวเลือกนี้ ",
