        "vaeua-gui-eua.Properties.svm.missingvalue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ขยายแบบจำลองเพื่อนำการสังเกตการณ์ที่มีค่าที่ขาดหายไปมารวมและให้นำค่าที่ขาดหายไปในตัวแปรตอบสนองมารวม ตัวคาดการณ์ที่ไม่มีเงื่อนไขจะปฏิบัติต่อค่าที่หายไปเหมือนกับเป็นค่าที่แยกกัน ตัวคาดการณ์ต่อเนื่องแทนที่ค่าที่หายไปด้วยค่าเฉลี่ยของตัวคาดการณ์</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.maximumSeconds.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ใช้ระยะเวลาสูงสุดตามค่าเริ่มต้นเพื่อฝึกระบบโครงข่ายประสาท (neural network) ค่าเริ่มต้นคือ 270</p></section>',
