        "vaeua-gui-eua.yAxisTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">ตัวเลือก <span class\\="xis-windowItem">แสดงผลค่าติ๊ก</span> ระบุวิธีการที่ใช้ในการปรับค่าเครื่องหมายติ๊กบนแกน Y คุณสามารถระบุดังต่อไปนี้\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">ปล่อยบางรายการ</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">ใส่ค่าติ๊กบางส่วน</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">แสดงทั้งหมด</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">แสดงค่าติ๊กทั้งหมด</p></dd></dl></div>                 </div></section>',
