        "vaeua-gui-eua.sas.van.control.initialMinValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุค่าต่ำสุดเริ่มต้น (ขีดจำกัดล่าง) สำหรับการควบคุม ค่าเริ่มต้นถูกเลือกในครั้งแรกที่ผู้ใช้เปิดรายงาน หรือเมื่อผู้ใช้เลือก<span class\\="xis-windowItem">คืนค่าสถานะรายงานเริ่มต้น</span></p><div class\\="xis-paragraph">ป้อนค่าในฟิลด์ข้อความหรือระบุค่าหนึ่งค่าดังต่อไปนี้\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">อัตโนมัติ</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">ระบุว่าการเลือกของคุณถูกบันทึกเป็นค่าเริ่มต้นเมื่อคุณบันทึกรายงาน</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">ค่าต่ำสุด</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">ระบุว่าค่าต่ำสุดในการควบคุมคือค่าเริ่มต้น</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">ชื่อพารามิเตอร์</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">ระบุว่าค่าของพารามิเตอร์ที่คุณเลือกคือค่าเริ่มต้นสำหรับการควบคุม</p><p class\\="xis-paraSimple">คุณสามารถเลือกพารามิเตอร์ได้ก็ต่อเมื่อมีพารามิเตอร์ที่มีประเภทข้อมูลที่เหมาะสมอยู่แล้ว</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.analyzeSentiment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">วิเคราะห์ความอ่อนไหวของเอกสารแต่ละอย่างโดยอิงตามการใช้คำเชิงบวกและคำเชิงลบ</p></section>',
