        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ความพยายามในการสร้างเครือข่ายแบบเบย์อย่างง่ายแบบต้นไม้ขยาย ซึ่งรวมลิงก์โดยตรงจากตัวแปรการตอบสนองไปยังตัวคาดการณ์แต่ละตัว รวมถึงโครงสร้างต้นไม้ในหมู่ตัวคาดการณ์ เครือข่ายแบบเบย์อย่างง่ายแบบต้นไม้ขยาย จำเป็นต้องให้จำนวนพาเรนต์มากที่สุดเป็นสองเสมอ</p></section>',
