        "vaeua-gui-eua.Properties.bayesNet.parentChild.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ความพยายามในการสร้างเครือข่ายแบบเบย์แบบพาเรนต์-ชายด์ ซึ่งขยายเครือข่ายแบบเบย์อย่างง่าย การขยายนี้อนุญาตให้ตัวคาดการณ์เป็นพาเรนต์ของตัวแปรการตอบสนอง ลิงก์ระหว่างพาเรนต์และชิลเดรนของตัวแปรการตอบสนอง และลิงก์ในหมู่ชิลเดรนของตัวแปรการตอบสนอง</p></section>',
