        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุจำนวนคลัสเตอร์ที่จะสร้าง หรือระบุว่าควรใช้วิธีเกณฑ์กล่องจัดแนว (ABC) เพื่อให้ได้รับจำนวนคลัสเตอร์ที่เหมาะสมที่สุด</p><p class\\="xis-paragraph">วิธี ABC จะเลือกจำนวนคลัสเตอร์บางส่วนที่จะสร้างก่อน จากนั้นสร้างคลัสเตอร์ และคำนวณสถิติช่องว่างสำหรับแต่ละคลัสเตอร์ ถัดจากนั้น จะสร้างการกระจายอ้างอิงที่เรียงตัวรอบๆ คลัสเตอร์แต่ละกลุ่มและสถิติช่องว่างสำหรับการกระจายอ้างอิงแต่ละตัวออกมา กระบวนการนี้จะถูกทำซ้ำสำหรับจำนวนคลัสเตอร์ที่เป็นไปได้ทั้งหมด จำนวนคลัสเตอร์ที่เพิ่มความแตกต่างรวมระหว่างสถิติช่องว่างของคลัสเตอร์และข้อมูลอ้างอิงได้สูงสุด จะถูกเลือกเป็นจำนวนคลัสเตอร์ที่เหมาะสมที่สุด</p><p class\\="xis-paragraph">วิธี ABC ใช้ได้เฉพาะเมื่ออินพุตทั้งหมดเป็นตัวแปรการวัดเท่านั้น</p></section>',
