        "vaeua-gui-eua.Properties.neuralnetwork.l1.help.tip.txt": "ข้อมูลเพิ่มเติมเกี่ยวกับตัวเลือกนี้ ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ใช้จำนวนตัวทำนายตามค่าเริ่มต้นเพื่อลองใช้กับส่วนที่แบ่งออกมาแต่ละส่วน ค่าเริ่มต้นคือรากที่สองของจำนวนตัวทำนายทั้งหมด หรือระบุจำนวนของตัวทำนายเพื่อลองใช้กับส่วนที่แบ่งออกมาแต่ละส่วน</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ระบุจำนวนของช่องเก็บที่จะใช้เพื่อจัดหมวดหมู่ตัวแปรการวัดในกราฟการพึ่งพาบางส่วน</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">เปิดใช้งานอัลกอริทึมการจัดกลุ่มค่าเฉลี่ย k แบบรวดเร็ว (fast k-means clustering algorithm) และข้ามการเรียงลำดับถัง ห้ามเลือกตัวเลือกนี้หากคุณต้องการใช้ greedy search algorithm และการเรียงลำดับถังที่เกี่ยวข้อง การตอบสนองการวัดที่ไม่มีถังใช้ตัวแปรเป็นเกณฑ์การคัดเลือก เมื่อเลือกตัวเลือกนี้ การตอบสนองของหมวดหมู่และการตอบสนองการวัดที่มีถังจะใช้เกณฑ์อัตราส่วนการได้รับ ไม่เช่นนั้น จะใช้การได้รับสัมบูรณ์</p></section>',
