        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">ระบุที่ใช้เพื่อคำนวณเวลาในการเดินทางสำหรับฟีเจอร์กราฟิก เลือกหนึ่งในตัวเลือกดังต่อไปนี้\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">ไม่</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">ระบุว่าการคำนวณเวลาในการเดินทางใช้ค่าเฉลี่ยถ่วงน้ำหนักของข้อมูลการจราจรที่ผ่านมาสำหรับตลอดเวลาของวันและสำหรับทุกวันของสัปดาห์</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">การจราจรปัจจุบัน</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">ระบุว่าการคำนวณเวลาในการเดินทางใช้เงื่อนไขการจราจรปัจจุบัน คุณสามารถอัปเดตข้อมูลการจราจรโดยคลิกที่ <span data-icon-name\\="refresh" alt\\="ไอคอนอัปเดตข้อมูลการจราจร" aria-label\\="ไอคอนอัปเดตข้อมูลการจราจร"></span> เมื่อผู้ใช้ตรวจสอบรายงาน การจราจรจะไม่อัปเดตโดยอัตโนมัติ ผู้ใช้จะต้องอัปเดตข้อมูลการจราจรเพื่อที่จะสะท้อนเงื่อนไขการจราจรล่าสุดได้</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">การจราจรทั่วไป</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">ระบุว่าการคำนวณเวลาในการเดินทางใช้การจราจรทั่วไปสำหรับเวลาและวันของสัปดาห์ที่ระบุไว้ เงื่อนไขการจราจรทั่วไปจะขึ้นอยู่กับข้อมูลประวัติที่ผ่านมา</p><div class\\="xis-note"><span class\\="xis-noteGenText">หมายเหตุ\\:</span>เวลาที่คุณระบุเป็นเวลาท้องถิ่นสำหรับตำแหน่งที่ตั้งบนแผนที่</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">หมายเหตุ\\:</span>การเรียกข้อมูลเวลาในการเดินทางจะใช้เครดิตของบริการพรีเมียมของ Esri</div><div class\\="xis-note"><span class\\="xis-noteGenText">หมายเหตุ\\:</span>ถ้าไม่มีข้อมูลการจราขนสำหรับพื้นที่ที่มีการคำนวณเวลาในการเดินทาง ระบบจะใช้ชีดจำกัดความเร็วที่ประกาศไว้เพื่อคำนวณเวลาในการเดินทาง</div></section>',
