        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">ตัวเลือก<span class\\="xis-windowItem">การหมุนรอบรูปแบบองค์ประกอบข้อมูล</span> ระบุลักษณะการกำหนดรูปแบบสำหรับองค์ประกอบข้อมูลในเทมเพลตกราฟ เช่น ในแผนภูมิเส้น ตัวเลือกนี้จะระบุลักษณะสี รูปแบบเส้น และตัวทำเครื่องหมายที่ใช้เพื่อแยกความแตกต่างระหว่างเส้นในกราฟ <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">อัตโนมัติ</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">ใช้การตั้งค่าการหมุนรูปแบบจากธีม ธีม SAS ส่วนใหญ่ใช้การตั้งค่า <span class\\="xis-windowItem">หมุนรอบสีทั้งหมดก่อน</span> ธีมความคมชัดสูงจะใช้การตั้งค่า <span class\\="xis-windowItem">หมุนรอบคุณลักษณะทั้งหมด</span></p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">หมุนรอบสีทั้งหมดก่อน</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">แสดงการเติมสีทึบ เส้นทึบ และรูปร่างตัวทำเครื่องหมายที่สม่ำเสมอจนถึงสีทั้งหมดในจานสีที่ใช้</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">หมุนรอบคุณลักษณะทั้งหมด</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">แสดงรูปแบบการเติมแบบต่างๆ รูปแบบเส้น และรูปร่างตัวทำเครื่องหมายที่เพิ่มเติมจากสีต่างๆ การตั้่งค่านี้สามารถปรับปรุงตัวช่วยการเข้าถึงสำหรับผู้ใช้ที่มีความบกพร่องในการมองเห็นสี (ตาบอดสี)</p></dd></dl></div>                 </div></section>',
